from struct import iter_unpack


def parse_entity_sizes(data_hex):
  data_b = bytearray.fromhex(data_hex)
  return [int(data_b[i*38 + 12]) for i in range(111)]

entity_sizes = parse_entity_sizes("")

def parse_entities(pos_entities_hex, entities_hex):
  entities_b = bytearray.fromhex(entities_hex)
  entities = []

  for offset, in iter_unpack('>h', bytearray.fromhex(pos_entities_hex)):
    if offset >= 0:
      n = int(entities_b[offset])
      for i in range(n):
        ent_type = int(entities_b[offset + 1])
        entities.append((ent_type,))
        offset += entity_sizes[ent_type]
  return entities

