def count_entity_type(level_entities, needle_type):
  return sum(1 for ent_type, in level_entities if ent_type == needle_type)

def find_entity(ent_type):
  print(f"Looking for entity type 0x{ent_type:02x}")
  found = False
  for level, entities in level_entities.items():
    n = count_entity_type(entities, ent_type)
    if n > 0:
      print(f"{level}: {n}")
      found = True
  if not found:
    print("Not found")

import sys
find_entity(int(sys.argv[1], 16))
